length=${#arr[*]}
echo "length = " $length
count=0
for s in ${arr[*]}
do
    count=`expr $count + 1`;
    path=${s%=*}
    url=${s##*=}
    echo $count "/" $length $path $url
    # –all：将本地的所有分支都推送到远程仓库。
    # –tags：将本地的所有标签推送到远程仓库。
    cd $path
    echo "enter in" $(pwd)
    git push --all $url
    echo "push all down"
    git push --tags $url
    echo "push tags down"
done